import React from 'react'

const headerStyle = {
    height: '7vh',
    border: "1px solid red",
    display: 'flex',
    justifyContent: 'space-around'
}

const logoStyle = {
    width: "30%",
    border: "1px solid green",
}

const itemStyle = {
    width: "70%",
    border: "1px solid blue",
}


export default function Header() {
  return (
    <div style={headerStyle}>
      <div style={logoStyle}>logo</div>
      <div style={itemStyle}>
        <div>Add User</div>
        <div></div>
        <div></div>
        <div></div>
      </div>
    </div>
  );
}
